const ReviewList = ({reviewList}) => {
    return (
        <div>
            {reviewList.map((it) => (
                <div key={it.id}>{it.content}</div>
            )

            )}
        </div>
    );
};

ReviewList.defaultProps = {
    reviewList : [],
};

export default ReviewList;
